INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2743, 'esMX', 'Celestial tormentáureo', '|cFFFFD200Tienda del juego|r', 'Ornamentado por el trueno, elegido por el destino. Un relámpago dorado cubre sus pezuñas y atraviesa el cielo como si perforara la noche. Las leyendas lo vinculan estrechamente con el emperador Shaohao.', 65727),
(2742, 'esMX', 'Celestial Pezuña Trueno', '|cFFFFD200Tienda del juego|r', 'Después de la caída del Rey del Trueno, el remanente de su trueno se fundió con el espíritu de un dragón blanco. Viaja a lo largo de relámpagos azur, las nubes se arremolinan a su paso y, donde antes reinaba la tiranía, ahora hay una luz guardiana.', 65727),
(2798, 'esMX', 'Alatumba de bronce', '|cFFFFD200Logro: |rMaestro de los portales del tiempo turbulentos IV|n|cFFFFD200Categoría:|r Cronoviaje|n', 'Si bien la estética oscura y ominosa es algo que les gusta a quienes residen en Revendreth, hay algunos que todavía eligen el brillo resplandeciente.', 65727),
(2797, 'esMX', 'Mosca cadavérica de bronce', '|cFFFFD200Logro: |rMaestro de los portales del tiempo turbulentos IV|n|cFFFFD200Categoría:|r Cronoviaje', 'Se necesita mucho esfuerzo para decorar una mosca cadavérica, pero algunos opinan que vale la pena.', 65727),
(2796, 'esMX', 'Aquilón de bronce', '|cFFFFD200Logro: |rMaestro de los portales del tiempo turbulentos IV|n|cFFFFD200Categoría:|r Cronoviaje|n|n', 'Los confiables corceles de Bastión están concebidos para emular a los orgullosos y nobles guerreros de los Ascendidos.', 65727),
(2795, 'esMX', 'Salvajezno de bronce', '|cFFFFD200Logro: |rMaestro de los portales del tiempo turbulentos IV|n|cFFFFD200Categoría:|r Cronoviaje|n|n', 'Los salvajeznos reales retozan por el cielo, libres como la magia descontrolada que impulsa su vuelo.', 65727),
(1729, 'esMX', 'Resbaladizo, el Escurridizo', '|cFFFFD200Misión:|r El bravo invertebrado|n|cFFFFD200Zona: |rCaverna Zaralek', 'Gran corazón, grandes sueños y bien resbaladizo.', 65727);
